    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);

        setContentView(R.layout.activity_three_dgraph);

        this.mNChartView = (NChartView) findViewById(R.id.nchart3d);

        loadView();

        int countID = 0;
        for (int i=1; i<activities.length; i++) {
            String[] split = activities[i].split(",");

            String classification = split[1];

            ArrayList<Double> xs = new ArrayList<>();
            ArrayList<Double> ys = new ArrayList<>();
            ArrayList<Double> zs = new ArrayList<>();
            for (int index=2; index < split.length; index += 3) {
                double x_i = Double.parseDouble(split[index]);
                double y_i = Double.parseDouble(split[index + 1]);
                double z_i = Double.parseDouble(split[index + 2]);

                xs.add(x_i);
                ys.add(y_i);
                zs.add(z_i);
            }
            xPoints.add(xs);
            yPoints.add(ys);
            zPoints.add(zs);

            NChartLineSeries seriesX = new NChartLineSeries();
            NChartLineSeries seriesY = new NChartLineSeries();
            NChartLineSeries seriesZ = new NChartLineSeries();
            seriesX.tag = countID;
            seriesY.tag = countID+1;
            seriesZ.tag = countID+2;

            countID += 3;

            seriesX.setDataSource(this);
            seriesY.setDataSource(this);
            seriesZ.setDataSource(this);

            if (classification.equals("EATING")) {
                seriesX.setBrush(new NChartSolidColorBrush(Color.GREEN));
                seriesY.setBrush(new NChartSolidColorBrush(Color.GREEN));
                seriesZ.setBrush(new NChartSolidColorBrush(Color.GREEN));
            } else if (classification.equals("WALKING")) {
                seriesX.setBrush(new NChartSolidColorBrush(Color.RED));
                seriesY.setBrush(new NChartSolidColorBrush(Color.RED));
                seriesZ.setBrush(new NChartSolidColorBrush(Color.RED));
            } else if (classification.equals("RUNNING")) {
                seriesX.setBrush(new NChartSolidColorBrush(Color.BLUE));
                seriesY.setBrush(new NChartSolidColorBrush(Color.BLUE));
                seriesZ.setBrush(new NChartSolidColorBrush(Color.BLUE));
            }
            mNChartView.getChart().addSeries(seriesX);
            mNChartView.getChart().addSeries(seriesY);
            mNChartView.getChart().addSeries(seriesZ);
        }

        mNChartView.getChart().updateData();
    }

    private void loadView() {
        mNChartView.getChart().setLicenseKey("");

        // Switch on antialiasing.
        mNChartView.getChart().setShouldAntialias(true);

        mNChartView.getChart().getCartesianSystem().setMargin(new NChartMargin(10.0f, 10.0f, 10.0f, 20.0f));

        mNChartView.getChart().setDrawIn3D(true);
    }

    @Override
    public NChartPoint[] points(NChartSeries nChartSeries) {
        int tag = nChartSeries.tag;
        int activityID = tag / 3;
        int xYOrZ = tag % 3;
        ArrayList<Double> points = null;
        if (xYOrZ == 0) {
            points = xPoints.get(activityID);
        } else if (xYOrZ == 1) {
            points = yPoints.get(activityID);
        } else if (xYOrZ == 2) {
            points = zPoints.get(activityID);
        }

        NChartPoint[] result = new NChartPoint[points.size()];
        for (int i=0; i<result.length; i++) {
            result[i] = new NChartPoint(NChartPointState.PointStateAlignedToXZWithXYZ(i, points.get(i), activityID), nChartSeries);
        }

        return result;
    }

